con:configuration.path:
declare namespace soap='http://www.w3.org/2003/05/soap-envelope';
declare namespace m='http://www.oorsprong.org/websamples.countryinfo';
<result>
{
for $k in //m:tCountryCodeAndName
where starts-with($k/m:sName, 'G')
return <data>{data($k/m:sName/text())}</data>
}
</result>

con:configuration.scriptText:
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def holder = groovyUtils.getXmlHolder(messageExchange.responseContent)

//Define the NameSpace
holder.namespaces["m"] = "http://www.oorsprong.org/websamples.countryinfo"


def addResult1 = holder.getAt("//m:sISOCode")
def addResult2 = holder.getAt("//m:sName")

boolean isGiven = false
try{
	for(int i = 0;i<=246;i++)
	{

		if(addResult1[i].equals("GN"))
		{
			log.info addResult2[i]
			isGiven = true;
		}
		if(isGiven)break;

	}
}
catch(Exception e)
{
	isGiven=false	
}

if(isGiven)
{ log.info "Pass" }
else
{ log.info "fail"}
